  fd_bincode_uint64_decode_unsafe( &self->data_len, ctx );
  if( self->data_len ) {
    self->data = *alloc_mem;
    fd_bincode_bytes_decode_unsafe( self->data, self->data_len, ctx );
    *alloc_mem = (uchar *)(*alloc_mem) + self->data_len;
  } else
    self->data = NULL;
  fd_pubkey_decode_inner( &self->owner, alloc_mem, ctx );
