  fd_hard_forks_decode_inner( &self->hard_forks, alloc_mem, ctx );
  fd_bincode_uint64_decode_unsafe( &self->transaction_count, ctx );
  fd_bincode_uint64_decode_unsafe( &self->tick_height, ctx );
