  if( FD_UNLIKELY( err ) ) return err;
  err = fd_bincode_uint64_encode( self->block_height, ctx );
  if( FD_UNLIKELY( err ) ) return err;
  err = fd_bincode_uint64_encode( self->max_tick_height, ctx );
  if( FD_UNLIKELY( err ) ) return err;
  err = fd_bincode_uint64_encode( self->collected_execution_fees, ctx );
